import unittest


class Solution:
    def numWays(self, s: str) -> int:
        count_1s = 0
        for v in s:
            if v == "1":
                count_1s += 1
        if count_1s % 3 != 0:
            return 0
        partition = count_1s / 3
        if count_1s == 0:
            ans = 0
            for x in range(1, len(s) - 1):
                ans += x
            return ans % (pow(10, 9) + 7)
        cx = 0
        zi = [0, 0, 0]
        i = -1
        count_zeros = False
        for v in s:
            if v == "1":
                cx += 1
                count_zeros = False

            if cx == partition:
                count_zeros = True
                i += 1
                cx = 0
            if count_zeros and v == "0":
                zi[i] += 1

        return ((zi[0] + 1) * (zi[1] + 1)) % (pow(10, 9) + 7)


class Tests(unittest.TestCase):

    def test1(self):
        tests = [
            [["10101"], 4],
            [["0000"], 3],
            [["000000"], 10],
            [["100100010100110"], 12],
            [["0000010101"], 4],
            [
                [
                    ""
                ],
                49954972,
            ],
        ]
        for i in tests:
            self.assertEqual(Solution().numWays(*i[0]), i[1])


if __name__ == "__main__":
    unittest.main()
